import React from 'react';
import Slide from './Slide.jsx'; // Assuming Slide component is in the same directory
import './Carousel.css'; // Assuming you have a separate CSS file for styling
import ProductBanners from './ProductBanners';

const Carousel = () => {
  return (
    <div className="carousel_container">
      {ProductBanners.map((item) => (
        <Slide
          key={item.id} // Don't forget to provide a unique key prop
          id={item.id}
          title={item.title}
          url={item.url}
        />
      ))}
    </div>
  );
};

export default Carousel;
